import React from 'react';

const RouterPanel = (props) => {

  const routerStyle = {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'space-around',
      backgroundColor: '#E4F6F5',
      width: '18%',
    };

  const RouterList = () => {
    let list = [];
    for(let key in props.routers){
      list.push(
        <div>
          props.routers[key]
        </div>
      )
    }
    return list;
  };


  return  (
            <div style={routerStyle} >
              <RouterList />
            </div>
          );
};

export default RouterPanel;
